import React from 'react';
import {BrowserRouter, Routes, Route} from "react-router-dom";

import Home from "./Router/Home";
import ServicesRoute from "./Router/ServicesRoute";
import BlogRoute from "./Router/BlogRoute";
import ContactRoute from "./Router/ContactRoute";
import ReservationRoute from "./Router/ReservationRoute";
import InformationRoute from "./Router/InformationRoute";
import ServicesRouteNews from "./Router/ServicesRouteNews";
import ProductRoute from "./Router/ProductRoute";
import News1Route from "./Router/News1Route";
import News2Route from "./Router/News2Route";
import News3Route from "./Router/News3Route";



export default function App() {
    return (
        <>
            <BrowserRouter>
                <Routes>
                    <Route path='/' element={<Home/>}/>
                    {/*<Route path='/ServicesRoute&Pricing' element={<ServicesRoute/>}/>*/}
                    {/*<Route path='/Blog' element={<BlogRoute/>}/>*/}
                    {/*<Route path='/Contact' element={<ContactRoute/>}/>*/}
                    {/*<Route path='/reservation' element={<ReservationRoute/>}/>*/}
                    {/*<Route path='/information' element={<InformationRoute/>}/>*/}
                    {/*<Route path='/services' element={<ServicesRouteNews/>}/>*/}
                    {/*<Route path='/products' element={<ProductRoute/>}/>*/}
                    {/*<Route path='/blog_news1' element={<News1Route/>}/>*/}
                    {/*<Route path='/blog_news2' element={<News2Route/>}/>*/}
                    {/*<Route path='/blog_news3' element={<News3Route/>}/>*/}
                </Routes>
            </BrowserRouter>
        </>
    )
}
